import React from "react";
import Ticker from "./Ticker";

const TickersCopy = ({ tickers }) => {
  return (
    <>
      {tickers.map((ticker) => (
        <Ticker key={ticker.id} ticker={ticker}>
          {ticker.tickername}
        </Ticker>
      ))}
    </>
  );
};

export default TickersCopy;
